import React from 'react';
import ReactDOM from "react-dom";
import App from "./App";

import {addPosts} from "./Redux/state";

export let rebootS = (state)=>{
    ReactDOM.render(<App state={state} addPosts={addPosts} />, document.getElementById('root'));
}
